import React from 'react';
import Icon1 from "./icons/icon1.png";
import Icon2 from "./icons/icon2.png";
import Icon3 from "./icons/icon3.png";


const PRICING = [
    {
        name:"Personal" ,
        features:"custom domains",
        cost: "Free",
        buttonName: "Sign Up",
        icon:Icon1,
    },
    {
        name:"Personal" ,
        features:"custom domains",
        cost: "Free",
        buttonName: "Sign Up",
        icon:Icon1,
    },
    {
        title: "Auto-created customer profiles",
        description: "The customer profile will be instantly created under the appropriate shop once a shop owner has added the appointment.",
        icon: Icon3
    },
];

function App() {
    return (
        <div className='container mx-auto px-16 py-24 border p-5 gap-16 '>
            <div className="grid grid-cols-3 gap-16">
                {PRICING.map((pricing) => (
                    <div className="border rounded-lg p-5">
                        <div className="mb-8">
                           {pricing.icon}
                        </div>
                        <h3 className='text-xl font-semibold  mb-4'>{pricing.title}</h3>
                        <p className='text-md'>{pricing.description}</p>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default App;
